const deleteRequest = (expression, result) => {
  fetch('/', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      expression,
      result,
    }),
  }).then((res) => res.json())
}

export default deleteRequest
